//FUNCTIONS
// Weighted moving average (from Pluvtech)
function WMA(src, len) {
    let pLen = src.length
    if (pLen < len) { return 0 }

    let count = 1
    let numerator = 0
    for (let i = pLen - len; i < pLen; i++, count++) {
        numerator += src[i] * count
    }
    return (numerator / ((len * (len + 1)) / 2))
}

// Rate of Change
function ROC(src, len) {
    let values = src.slice(-len)
    let start = values[0]
    let end = values[values.length - 1]

    return 100 * (end - start) / len
}

