let candle = record.current;
let last256Len = variable.last256Close.push(candle.close);
if (last256Len > 256) {
    // Larger splice to avoid every > 256 performing splice call;
    // splice by largest length parameter:
    let sAmt = Math.max(variable.CHANNEL_LENGTH, variable.FAST_LENGTH,
                        variable.SLOW_LENGTH, variable.DEAD_ZONE_LENGTH);
    variable.last256Close.splice(0, (last256Len - sAmt));
    last256Len = variable.last256Close.length;
}

/* ----- Function Section: ----- */
/* Helper Functions: */
let STDev = function (dataArr) {
    let mean = dataArr.reduce((a, b) => a + b, 0) / dataArr.length;
    return Math.sqrt(dataArr.reduce((sq, n) => sq +
            Math.pow(n - mean, 2), 0) / (dataArr.length - 1));
};

function ema(source, len, emaPrevious) {
    let multiplier = 2 / (len + 1);
    return source * multiplier + emaPrevious * (1 - multiplier);
}

function sma(dataArr, len) {
    sum = dataArr.slice(dataArr.length - len).reduce((a, b) => a + b, 0);
    return sum / len;
}

/* Waddah Functions */
function macd(source, fastLen, slowLen, emaFastPrev, emaSlowPrev) {
    let fastMA = ema(source, fastLen, emaFastPrev);
    let slowMA = ema(source, slowLen, emaSlowPrev);
    return fastMA - slowMA;
}

// *Note* - BB will use close and not typical ((high + low + close) / 3) for this instance of indicator.
function BBUpper(source, len, multiplier) {
    let basis = sma(source, len);
    let dev = multiplier * STDev(source.slice(source.length - len));
    return basis + dev;
}

function BBLower(source, len, multiplier) {
    let basis = sma(source, len);
    let dev = multiplier * STDev(source.slice(source.length - len));
    return basis - dev;
}
/* ----- End Function Section ----- */

if (last256Len < variable.CHANNEL_LENGTH || 
    last256Len < variable.FAST_LENGTH ||
    last256Len < variable.SLOW_LENGTH) {
    variable.explosion = 0;
    variable.trendUp = 0;
    variable.trendDown = 0;
    variable.deadZone = 0;
}
