                        variable.emaFastPrevPrev, variable.emaSlowPrevPrev)) * variable.SENSITIVITY;

    variable.explosion = (BBUpper(variable.last256Close, variable.CHANNEL_LENGTH, variable.STDMULT) -
                            BBLower(variable.last256Close, variable.CHANNEL_LENGTH, variable.STDMULT));

    variable.trendUp = (trend1 >= 0) ? trend1 : 0;
    variable.trendDown = (trend1 < 0) ? (-1 * trend1) : 0;
    variable.emaFastPrevPrev = variable.emaFastPrev;
    variable.emaSlowPrevPrev = variable.emaSlowPrev;
    variable.emaFastPrev = ema(candle.close, variable.FAST_LENGTH, variable.emaFastPrev);
    variable.emaSlowPrev = ema(candle.close, variable.SLOW_LENGTH, variable.emaSlowPrev);

    // deadZone Calculation:
    let trueRange = Math.max( (candle.max - candle.min), 
                                Math.abs(candle.max - variable.last256Close[last256Len - 2]),
                                Math.abs(candle.min - variable.last256Close[last256Len - 2]));

    // rma Calculation:
    let alpha = 1 / variable.DEAD_ZONE_LENGTH;
    let sum = (variable.deadSumPrev === 0) ?
                trueRange :
                alpha * trueRange + (1 - alpha) * variable.deadSumPrev;
    variable.deadSumPrev = sum;
    variable.deadZone = sum * 3.7;
